htmx.defineExtension("client-side-templates",{transformResponse:function(e,t,n){var r=htmx.closest(n,"[mustache-template]");if(r){var a=JSON.parse(e),s=r.getAttribute("mustache-template");if(l=htmx.find("#"+s))return Mustache.render(l.innerHTML,a);throw"Unknown mustache template: "+s}var u=htmx.closest(n,"[handlebars-template]");if(u){a=JSON.parse(e);var i=u.getAttribute("handlebars-template");return Handlebars.partials[i](a)}var m=htmx.closest(n,"[nunjucks-template]");if(m){var l;a=JSON.parse(e),i=m.getAttribute("nunjucks-template");return(l=htmx.find("#"+i))?nunjucks.renderString(l.innerHTML,a):nunjucks.render(i,a)}return e}});
